import{o as e,c as t,a as r}from"./app.8ae45ef2.js";const a='{"title":"Introduction","description":"","frontmatter":{},"relativePath":"guide/index.md","lastUpdated":1616538204000}',n={},o=r('<h1 id="introduction"><a class="header-anchor" href="#introduction" aria-hidden="true">#</a> Introduction</h1><p>VuePress is composed of two parts: a <a href="https://github.com/vuejs/vuepress/tree/master/packages/%40vuepress/core" target="_blank" rel="noopener noreferrer">minimalistic static site generator</a> with a Vue-powered <a href="https://v1.vuepress.vuejs.org/theme/" target="_blank" rel="noopener noreferrer">theming system</a> and <a href="https://v1.vuepress.vuejs.org/plugin/" target="_blank" rel="noopener noreferrer">Plugin API</a>, and a <a href="https://v1.vuepress.vuejs.org/theme/default-theme-config.html" target="_blank" rel="noopener noreferrer">default theme</a> optimized for writing technical documentation. It was created to support the documentation needs of Vue&#39;s own sub projects.</p><p>Each page generated by VuePress has its own pre-rendered static HTML, providing great loading performance and is SEO-friendly. Once the page is loaded, however, Vue takes over the static content and turns it into a full Single-Page Application (SPA). Additional pages are fetched on demand as the user navigates around the site.</p>',3);n.render=function(r,a,n,s,i,d){return e(),t("div",null,[o])};export default n;export{a as __pageData};
